    \u0275\u0275text(50, "3. Objet");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(51, "p");
    \u0275\u0275text(52, " La pr\xE9sente Politique de confidentialit\xE9 a pour objet d\u2019assurer le respect des droits et libert\xE9s des Utilisateurs cyclistes ainsi que la confidentialit\xE9, la s\xE9curit\xE9 et la minimisation des traitements des donn\xE9es \xE0 caract\xE8re personnel par la soci\xE9t\xE9 HUMAN CONCEPT. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(53, "p");
    \u0275\u0275text(54, " La pr\xE9sente Politique d\xE9crit la fa\xE7on dont la soci\xE9t\xE9 HUMAN CONCEPT recueille et utilise les donn\xE9es \xE0 caract\xE8re personnel fournies par les Utilisateurs cyclistes pour l\u2019utilisation de la Plateforme ECOVELO. ");
