    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(80, "h4");
    \u0275\u0275text(81, "7. Donn\xE9es collect\xE9es et transmises");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(82, "p");
    \u0275\u0275text(83, " Les donn\xE9es \xE0 caract\xE8re personnel recueillies par la soci\xE9t\xE9 HUMAN CONCEPT doivent r\xE9pondre pour leur collecte et leur traitement aux exigences l\xE9gislatives et r\xE8glementaires en vigueur. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(84, "p", 5);
    \u0275\u0275text(85, " Les donn\xE9es transmises \xE0 ECOVELO par les Utilisateurs cyclistes sont notamment : ");
