    \u0275\u0275text(88, "Le profil utilisateur");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(89, "li");
    \u0275\u0275text(90, "Les donn\xE9es de localisation des v\xE9los lou\xE9s");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(91, "li");
    \u0275\u0275text(92, "Les donn\xE9es portant sur les transactions");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(93, "li");
    \u0275\u0275text(94, "Les donn\xE9es d\u2019utilisation");
    \u0275\u0275elementEnd()();
    \u0275\u0275elementStart(95, "h5");
    \u0275\u0275text(96, "7.1 Profil utilisateur");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(97, "p");
    \u0275\u0275text(98, " Cela inclut notamment le nom et le Pr\xE9nom des Utilisateurs cyclistes, leur adresse \xE9lectronique, leur identifiant de connexion, leurs informations de paiement ou bancaires, leur num\xE9ro de t\xE9l\xE9phone. Ces informations sont obligatoires. A d\xE9faut, la soci\xE9t\xE9 HUMAN CONCEPT ne sera pas en mesure de fournir les services propos\xE9s et l\u2019Utilisateur cycliste ne sera pas autoris\xE9 \xE0 cr\xE9er de compte. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(99, "h5");
    \u0275\u0275text(100, "7.2 Donn\xE9es de localisation");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(101, "p");
    \u0275\u0275text(102, " Les donn\xE9es de localisation des v\xE9los lou\xE9s : ces donn\xE9es de localisation sont recueillies \xE0 l\u2019aide d\u2019un boitier embarqu\xE9 sur chacun des v\xE9los permettant aux Utilisateurs cyclistes d\u2019avoir notamment acc\xE8s au GPS, NFC, Interface \xE9cran-clavier, niveaux d\u2019assistance ou encore aux mises \xE0 jour. Il permet \xE9galement de retrouver un v\xE9lo vol\xE9, confirmer la localisation en freefloating ou encore suivre les mobilit\xE9s des Utilisateurs cyclistes sur le territoire. Les donn\xE9es incluent la date et l'heure d'utilisation, la localisation, l'itin\xE9raire et la distance parcourue. Ces donn\xE9es sont notamment utilis\xE9es pour placer l\u2019Utilisateur cycliste sur la carte pour trouver les stations et pour fixer le tarif applicable. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(103, "p");
    \u0275\u0275text(104, " les adresses IP : la soci\xE9t\xE9 HUMAN CONCEPT conserve \xE9galement les adresses IP des Utilisateurs cyclistes. Une adresse IP est un num\xE9ro d\u2019identification attribu\xE9 de fa\xE7on permanente ou provisoire \xE0 chaque appareil connect\xE9 \xE0 un r\xE9seau utilisant Internet. L\u2019adresse IP est per\xE7ue, du fait de sa fonction identificatrice, comme une donn\xE9e personnelle. De la m\xEAme mani\xE8re que l\u2019ensemble des donn\xE9es \xE0 caract\xE8re personnel recueillies et trait\xE9es par la soci\xE9t\xE9 HUMAN CONCEPT, les adresses IP font l\u2019objet d\u2019une protection. Leur conservation vise \xE0 faciliter le diagnostic de probl\xE8mes pouvant affecter le serveur de la soci\xE9t\xE9 HUMAN CONCEPT ainsi que l\u2019administration de cette plateforme et pour des raisons de s\xE9curit\xE9. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(105, "h5");
    \u0275\u0275text(106, "7.3 Donn\xE9es sur les transactions");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(107, "p");
    \u0275\u0275text(108, " Les donn\xE9es sur les transactions incluent les donn\xE9es relatives aux transactions associ\xE9s \xE0 l\u2019utilisation de la Plateforme ECOVELO, y compris le montant factur\xE9, le moyen de paiement, les informations relatives \xE0 la carte de paiement de l\u2019Utilisateur cycliste, ses donn\xE9es bancaires ainsi que les informations relatives \xE0 la distance parcourue. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(109, "h5");
    \u0275\u0275text(110, "7.4 Donn\xE9es d'utilisation");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(111, "p");
    \u0275\u0275text(112, " Les donn\xE9es d\u2019utilisation sont collect\xE9es et trait\xE9es par la soci\xE9t\xE9 HUMAN CONCEPT. Cela inclut notamment les donn\xE9es sur l'interaction des Utilisateurs cyclistes avec la Plateforme ECOVELO et celles sur le parcours de navigation et des interactions avec le contenu de la Plateforme ECOVELO, telles que les pages visit\xE9es, les mots-clefs de recherche utilis\xE9e, la fr\xE9quence des visites sur la plateforme ou encore les publicit\xE9s \xE9ventuelles sur lesquelles l\u2019utilisateur clique. Cela comprend aussi les dates et heures d'acc\xE8s, les fonctionnalit\xE9s ou les pages d'application utilis\xE9es, les pannes d'application et les autres activit\xE9s associ\xE9es au syst\xE8me, le type de navigateur, et les sites Web ou services tiers utilis\xE9s avant l'interaction avec les services de la soci\xE9t\xE9 HUMAN CONCEPT. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(113, "p");
    \u0275\u0275text(114, " Les donn\xE9es prises en compte sont \xE9galement celles permettant d\u2019avoir un suivi des Utilisateurs cyclistes et des locations, un suivi temporel des entr\xE9es-sorties sur les stations, un suivi des niveaux de batterie et des rotations en atelier, un suivi des usages de la billettique et des statistiques g\xE9n\xE9rales diverses. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(115, "p");
    \u0275\u0275text(116, " Dans certains cas, ces donn\xE9es sont recueillies par l'interm\xE9diaire de cookies. Pour en savoir plus sur les cookies, consultez la politique de cookies. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(117, "h4");
    \u0275\u0275text(118, "8. Consentement des Utilisateurs cyclistes");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(119, "p");
    \u0275\u0275text(120, " Les Utilisateurs cyclistes consentent de mani\xE8re positive \xE0 la collecte et au traitement de leurs donn\xE9es personnelles par l\u2019acceptation de la pr\xE9sente Politique de confidentialit\xE9 emport\xE9e par l\u2019acceptation des CGAU. Lors de la collecte et du traitement des donn\xE9es personnelles, les Utilisateurs cyclistes sont avertis du caract\xE8re obligatoire ou facultatif des informations demand\xE9es pour b\xE9n\xE9ficier du service. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(121, "p");
    \u0275\u0275text(122, " Les Utilisateurs cyclistes sont \xE9galement inform\xE9s de l\u2019utilisation que la soci\xE9t\xE9 HUMAN CONCEPT fait des donn\xE9es fournies, et de leur droit d\u2019acc\xE8s, de rectification, d\u2019opposition, d\u2019effacement, ainsi que leur droit \xE0 la portabilit\xE9 des donn\xE9es et \xE0 la limitation des traitements. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(123, "p");
    \u0275\u0275text(124, " La soci\xE9t\xE9 HUMAN CONCEPT attire \xE9galement l\u2019attention des Utilisateurs cyclistes sur sa facult\xE9 de modifier la pr\xE9sente Politique de confidentialit\xE9 ainsi que les Conditions d\u2019Utilisation de la Plateforme. Les utilisateurs seront inform\xE9s par la soci\xE9t\xE9 HUMAN CONCEPT de tels changements et leur consentement devra \xEAtre r\xE9it\xE9r\xE9, lorsqu\u2019il est requis, en cas de modification de la finalit\xE9 de la collecte ou du traitement des donn\xE9es \xE0 caract\xE8re personnel. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(125, "p");
    \u0275\u0275text(126, " Les Utilisateurs cyclistes ont la facult\xE9, \xE0 tout moment, de retirer leur consentement concernant la collecte et le traitement de leurs donn\xE9es \xE0 caract\xE8re personnel. Ils doivent manifester leur volont\xE9 de retirer leur consentement \xE0 l\u2019adresse \xE9lectronique suivante : dpo@ecovelo.com. En cas de retrait de leur consentement, la soci\xE9t\xE9 HUMAN CONCEPT ne sera plus en mesure de fournir les services propos\xE9s. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(127, "h4");
    \u0275\u0275text(128, "9. Collecte et finalit\xE9 du traitement");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(129, "p");
    \u0275\u0275text(130, " Les Donn\xE9es Personnelles des Utilisateurs cyclistes sont n\xE9cessaires pour que la soci\xE9t\xE9 HUMAN CONCEPT leur permette l\u2019acc\xE8s \xE0 la Plateforme ainsi que son utilisation et son am\xE9lioration. Elles sont \xE9galement trait\xE9es et collect\xE9es obligatoirement afin de permettre \xE0 la soci\xE9t\xE9 HUMAN CONCEPT : ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(131, "ul")(132, "li");
    \u0275\u0275text(133, " D\u2019inscrire les cyclistes en tant qu\u2019utilisateurs des v\xE9los ECOVELO et de cr\xE9er leurs comptes. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(134, "li");
    \u0275\u0275text(135, " De collecter et traiter les adresses IP, informations de navigation (par exemple, historique des recherches) et autres donn\xE9es en rapport avec la navigation, li\xE9es \xE0 l\u2019utilisation de la Plateforme ECOVELO. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(136, "li");
    \u0275\u0275text(137, " De collecter et traiter les informations sur les appareils et logiciels. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(138, "li");
    \u0275\u0275text(139, "De suivre leur compte.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(140, "li");
