    \u0275\u0275elementStart(168, "h4");
    \u0275\u0275text(169, "10. La dur\xE9e de d\xE9tention de ces donn\xE9es");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(170, "p");
    \u0275\u0275text(171, " La soci\xE9t\xE9 HUMAN CONCEPT conserve les donn\xE9es personnelles des Utilisateurs cyclistes dans la limite de la r\xE9alisation de la finalit\xE9 poursuivie et de la r\xE9alisation des objectifs \xE9nonc\xE9s dans la pr\xE9sente Politique de confidentialit\xE9. ");
