    \u0275\u0275elementStart(172, "p");
    \u0275\u0275text(173, " Ces donn\xE9es sont ainsi conserv\xE9es pendant trois ans \xE0 compter de l\u2019\xE9ch\xE9ance du dernier abonnement. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(174, "p");
    \u0275\u0275text(175, " A l\u2019issu de ce d\xE9lai, ces donn\xE9es personnelles peuvent \xEAtre archiv\xE9es sur un support distinct afin de satisfaire aux obligations l\xE9gales, comptables et fiscales de la soci\xE9t\xE9 HUMAN CONCEPT. A titre d\u2019exemple, il est n\xE9cessaire de conserver pendant une dur\xE9e de dix ans des factures par application de l\u2019article L.123-22 du Code de commerce et/ou pendant le d\xE9lai de prescription applicable (comme le d\xE9lai de prescription de droit commun de cinq ans tel que pr\xE9vu \xE0 l\u2019article 2224 C. Civ.). ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(176, "h4");
    \u0275\u0275text(177, "11. Destinataires des donn\xE9es \xE0 caract\xE8re personnel");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(178, "p");
    \u0275\u0275text(179, " Les donn\xE9es personnelles collect\xE9es et trait\xE9es par la soci\xE9t\xE9 HUMAN CONCEPT ne font l\u2019objet d\u2019aucune communication \xE0 des tiers, except\xE9 dans certaines situations tels que les cas o\xF9 : ");
