    \u0275\u0275elementStart(180, "ul")(181, "li");
    \u0275\u0275text(182, " La soci\xE9t\xE9 HUMAN CONCEPT transf\xE8re certaines donn\xE9es personnelles n\xE9cessaires pour l\u2019accomplissement des taches n\xE9cessaires \xE0 la location de v\xE9lo par les Utilisateurs cyclistes. ");
