    \u0275\u0275elementStart(185, "li");
    \u0275\u0275text(186, " La soci\xE9t\xE9 HUMAN CONCEPT transf\xE8re certaines donn\xE9es personnelles pour lutter contre la fraude et contre toute activit\xE9 p\xE9nalement r\xE9pr\xE9hensible ou encore pour r\xE9pondre \xE0 une injonction des autorit\xE9s l\xE9gales. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(187, "li");
