    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(195, "h5");
    \u0275\u0275text(196, "12.2 Transfert de donn\xE9es en dehors de l\u2019Union Europ\xE9enne");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(197, "p");
    \u0275\u0275text(198, " Afin d\u2019assurer l\u2019ex\xE9cution et la gestion de ses services, la soci\xE9t\xE9 HUMAN CONCEPT transf\xE8re certaines donn\xE9es personnelles des Utilisateurs cyclistes \xE0 ses prestataires de service (notamment Stripe) situ\xE9s en dehors de l\u2019Union Europ\xE9enne (\xAB Pays Tiers \xBB). Ces prestataires de services s\u2019assurent de la conformit\xE9 au RGPD. Lorsque ces donn\xE9es sont transf\xE9r\xE9es vers des Pays Tiers pour lesquels la Commission Europ\xE9enne n\u2019a pas pris une d\xE9cision de \xAB protection ad\xE9quate \xBB, la soci\xE9t\xE9 HUMAN CONCEPT s\u2019assure que le transfert soit effectu\xE9 en conformit\xE9 avec la r\xE9glementation applicable et garantisse un niveau de protection suffisant de la vie priv\xE9e et des droits fondamentaux des personnes. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(199, "h4");
    \u0275\u0275text(200, "13. Droit des utilisateurs");
