    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(206, "li");
    \u0275\u0275text(207, " Le droit de rectification des donn\xE9es personnelles erron\xE9es ou obsol\xE8tes des Utilisateurs cyclistes. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(208, "li");
    \u0275\u0275text(209, " Le droit de mise \xE0 jour, de compl\xE9tude des donn\xE9es des Utilisateurs cyclistes. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(210, "li");
    \u0275\u0275text(211, " Le droit de suppression ou de verrouillage des donn\xE9es personnelles des Utilisateurs cyclistes, lorsqu\u2019elles sont inexactes, incompl\xE8tes, p\xE9rim\xE9s, \xE9quivoques, ou dont la collecte, la communication, l\u2019utilisation, ou la conservation est interdite. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(212, "li");
    \u0275\u0275text(213, "Le droit de retirer \xE0 tout moment un consentement.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(214, "li");
    \u0275\u0275text(215, " Le droit \xE0 la limitation du traitement des donn\xE9es des Utilisateurs cyclistes. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(216, "li");
    \u0275\u0275text(217, " Le droit d\u2019opposition au traitement des donn\xE9es personnelles \xE0 tout moment pour des raisons tenant \xE0 la situation particuli\xE8re des Utilisateur cyclistes, au traitement de leurs Donn\xE9es Personnelles sur le fondement de l\u2019int\xE9r\xEAt l\xE9gitime de la soci\xE9t\xE9 HUMAN CONCEPT ou aux traitements effectu\xE9s \xE0 des fins de marketing direct. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(218, "li");
    \u0275\u0275text(219, " Le droit \xE0 la portabilit\xE9 des donn\xE9es que les Utilisateurs cyclistes auront fournies, lorsque ces donn\xE9es font l\u2019objet de traitements automatis\xE9s bas\xE9s sur un contrat ou sur leur consentement. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(220, "li");
    \u0275\u0275text(221, " Le droit \xE0 la portabilit\xE9 des donn\xE9es des Utilisateurs cyclistes afin de pouvoir r\xE9cup\xE9rer une partie de leurs donn\xE9es. ");
