    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(227, "p");
    \u0275\u0275text(228, " Les demandes devront \xEAtre pr\xE9sent\xE9es \xE0 cette adresse, sign\xE9es et accompagn\xE9es de la photocopie d\u2019un titre d\u2019identit\xE9 portant la signature de l\u2019Utilisateur cycliste concern\xE9. La demande devra pr\xE9ciser l\u2019adresse a\u0300 laquelle devra parvenir la r\xE9ponse. La soci\xE9t\xE9 HUMAN CONCEPT dispose alors d\u2019un d\xE9lai d\u2019un mois pour r\xE9pondre, \xE0 compter de la r\xE9ception de la demande. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(229, "p");
    \u0275\u0275text(230, " Les Utilisateurs cyclistes disposent de la facult\xE9 de saisir la Commission nationale de l\u2019Informatique et des Libert\xE9s (dont les coordonn\xE9es figurent a\u0300 l\u2019adresse https://www.cnil.fr/fr/vous-souhaitez-contacter-la-cnil) dans l\u2019hypoth\xE8se ou\u0300 la soci\xE9t\xE9 HUMAN CONCEPT n\u2019aurait pas fait suite a\u0300 la demande dans le d\xE9lai d\u2019un mois suivant celle-ci. Au besoin, ce d\xE9lai peut e\u0302tre prolonge\u0301 de deux mois, compte tenu de la complexit\xE9 et du nombre de demandes. ");
