    \u0275\u0275elementStart(231, "h4");
    \u0275\u0275text(232, "14. S\xE9curit\xE9");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(233, "p");
    \u0275\u0275text(234, " Toute information fournie \xE0 la soci\xE9t\xE9 HUMAN CONCEPT par les Utilisateurs cyclistes est trait\xE9e avec la diligence et la s\xE9curit\xE9 requise. Aucune information ne sera utilis\xE9e d\u2019une autre mani\xE8re que celle \xE9nonc\xE9e dans la pr\xE9sente Politique de confidentialit\xE9 ou d\u2019une fa\xE7on non explicitement consentie par les Utilisateurs cyclistes. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(235, "h4");
    \u0275\u0275text(236, "15. Hyperliens vers des sites externes");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(237, "p");
