    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(239, "h4");
    \u0275\u0275text(240, "16. Amendement de la Politique de confidentialit\xE9");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(241, "p");
    \u0275\u0275text(242, " La d\xE9claration de confidentialit\xE9 peut \xEAtre mise \xE0 jour de mani\xE8re occasionnelle notamment lorsque la l\xE9gislation en vigueur \xE9volue. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(243, "h4");
    \u0275\u0275text(244, "17. Recours");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(245, "p");
    \u0275\u0275text(246, " Les Utilisateurs cyclistes, conform\xE9ment aux articles 77 et 78 du R\xE8glement 2016/679, peuvent introduire une r\xE9clamation concernant le non-respect du droit \xE0 la protection de leurs donn\xE9es personnelles, aupr\xE8s de la Commission Nationale de l\u2019Informatique et des Libert\xE9s (CNIL). ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(247, "p");
    \u0275\u0275text(248, " Les Utilisateurs cyclistes, conform\xE9ment \xE0 l\u2019article 79 du R\xE8glement 2016/679, peuvent introduire un recours juridictionnel si les droits que lui conf\xE8re la l\xE9gislation applicable ont \xE9t\xE9 viol\xE9s du fait d\u2019un traitement de ses donn\xE9es \xE0 caract\xE8re personnel. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(249, "p");
    \u0275\u0275text(250, " Enfin, conform\xE9ment \xE0 l\u2019article 82 du R\xE8glement 2016/679, les Utilisateurs cyclistes qui auraient subi un dommage mat\xE9riel ou moral du fait d\u2019une violation des droits conf\xE9r\xE9s par la l\xE9gislation applicable en mati\xE8re de protection des donn\xE9es \xE0 caract\xE8re personnel, ont le droit d\u2019obtenir du responsable de traitement la r\xE9paration du pr\xE9judice subi. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(251, "h4");
    \u0275\u0275text(252, "18. Contact et informations");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(253, "p");
    \u0275\u0275text(254, " Pour tout demande d\u2019information concernant la Politique de confidentialit\xE9 des donn\xE9es \xE0 caract\xE8re personnel de la soci\xE9t\xE9 HUMAN CONCEPT, il convient de s\u2019adresser \xE0 l\u2019adresse \xE9lectronique suivante : ");
    \u0275\u0275elementStart(255, "a", 4);
